Namely, the Hamiltonian $$\begin{aligned}
H_T=-J\sigma_0^z\sigma_1^z-J\sigma_0^z\sigma_2^z-J\sigma_1^z\sigma_2^z -h(\sigma_0^z+\sigma_1^z+\sigma_2^z)=\nonumber\\
=-J\sigma_1^z\sigma_2^z- h(\sigma_1^z+\sigma_2^z) -h\sigma_0^z-J\sigma_0^z(\sigma_1^z+\sigma_2^z)\end{aligned}$$ can be rewritten in the form (\[TotalH\]) with $$\begin{aligned}
\label{Twospin}
H=-J\sigma_1^z\sigma_2^z- h(\sigma_1^z+\sigma_2^z),\\
H_0=-h\sigma_0^z,\\
H_{\rm int}=-J\sigma_0^z(\sigma_1^z+\sigma_2^z),\end{aligned}$$ where $\lambda=J$ and $h_0=h$.
